import React from 'react';
import Input from '@material-ui/core/Input';

import './search-panel.css';

const SearchPanel = (props) => {
      return (
        <div>
          <Input placeholder="Search restaurants" {...props}/>
        </div>
    );
}

export default SearchPanel;
